import React, { useEffect, useState } from "react";
import { getHttp } from "../../service/APIRequest";

const CategoryDetails = ({ id }) => {
  console.log(id);
  const [subCategoryList, setSubCategoryList] = useState([]);

  useEffect(() => {
    fetchCatagoryList(id);
  }, []);

  const fetchCatagoryList = async (param?) => {
    const response = await getHttp("categories/" + 1 + "/subcategories");
    setSubCategoryList(response);
  };
  return (
    <div className="top-padding">
      <div className="back-button">
        <img
          src={require("../../assets/back.png")}
          alt=""
          width="50px"
          height="50px"
        />
      </div>
      <div>
        <li>{subCategoryList?.map((item, index) => item.label)}</li>
      </div>
    </div>
  );
};

export default CategoryDetails;
